    func ImageFromBlob(blob : String) -> UIImage
    {
        let dataDecoded:Data? = Data(base64Encoded: blob, options: NSData.Base64DecodingOptions.ignoreUnknownCharacters)
        
        if dataDecoded == nil
        {
            NSLog("empty image")
            return UIImage()
            
        }
        
        return UIImage(data: dataDecoded!)!
        
    }
    
    
    
